// Admin.js

import React from 'react';
import { Link, Route, Routes } from 'react-router-dom';
import GetWithPlz from './GetWithPlz';
import GetWithPri from './GetWithPri';
import TerminVerwalten from './TerminVerwalten';
import './Admin.css';

function Admin() {
  return (
    <div className="admin-container">
      <nav className="admin-navbar">
        <ul>
          <li>
            <Link to="/admin/getwithplz">Get with PLZ</Link>
          </li>
          <li>
            <Link to="/admin/getwithpri">Get with PRI</Link>
          </li>
          <li>
            <Link to="/admin/terminverwalten">Termin Verwalten</Link>
          </li>
        </ul>
      </nav>

      <hr />

      <Routes>
        <Route path="/admin/getwithplz" element={<GetWithPlz />} />
        <Route path="/admin/getwithpri" element={<GetWithPri />} />
        <Route path="/admin/terminverwalten" element={<TerminVerwalten />} />
      </Routes>
    </div>
  );
}

export default Admin;
